"use client"
import { jsPDF } from "jspdf"

const PDFGenerator = () => {
  // Initialize jsPDF
  // eslint-disable-next-line new-cap
  const doc = new jsPDF()
  const myFont =
    ""

  doc.addFileToVFS("Mukta-Regular.ttf", myFont)
  doc.addFont("Mukta-Regular.ttf", "Mukta", "normal")
  doc.setFont("Mukta")
  doc.setFontSize(24)
  const img = new Image()
  img.src = "/images/gov-logo.png"
  img.onload = () => {
    doc.addImage(img, "PNG", 10, 10, 30, 25)
    doc.text("शुद्धोधन गाउँपालिका", 60, 20)
    doc.text("गाउँ कार्यपालिकाको कार्यालय", 60, 30)

    // Body content
    doc.setFontSize(14)
    doc.setTextColor(255, 0, 0)

    // Save the PDF
    doc.save("nepali-text.pdf")
  }
}

export default PDFGenerator
